import styled from 'styled-components'
import logoImg from './assets/logo.png'

const Title = styled.h1`
  color: #8257e6;
  font-size: 64px;
`

export function App() {
  return (
    <div className="App">
      <img src={logoImg} alt="" />
      <Title>Hello World</Title>
    </div>
  );
}
